import React, { Component } from 'react'
import styled from 'styled-components'
import { properties, fSize, fWeight } from '../../conf/properties'
import TextBox from '../TextBox/TextBox'
import bgimage from '../../assets/images/25.jpg'
import nlogo from '../../assets/images/nlogo.png'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { fahome } from "@fortawesome/free-regular-svg-icons"
import { faBell } from "@fortawesome/free-regular-svg-icons"

const MainWrapper = styled.div`
  height : 54px;
  background-color : ${properties.white};
  border-bottom : 1px solid rgba(0, 40, 100, 0.12);
  display: flex;
  flex-direction: row;
  justify-content: center;
`
const SubWrapper = styled.div`
  width: 94%;
  /* height: inherit; */
  /* background-color : ${properties.otherBlue}; */
  display: flex;
  flex-direction: row;
  align-content: center;
`
const Menu1W = styled.div`
  width: 54px;
  background-color : ${properties.littleLightGrey};
  display: flex;
  flex-direction: row;
  align-content: center;
  justify-content: space-between;
  padding: 0px 12px;

`
const HomeIcon = styled.div`
  height: 14px;
  width: 14px;
  margin-right: 1rem;

`
class HeaderDown extends Component {
  render() {
    return (
      <MainWrapper>
        <SubWrapper>
          <Menu1W>
            <FontAwesomeIcon icon={faBell} color={properties.lightGrey} />
            <TextBox
              ffamily={"extraLight"}
              color={properties.lightGrey}
              fontSize={fSize.medium}>
              Home </TextBox>

          </Menu1W>
        </SubWrapper>
      </MainWrapper >
    )
  }
}


export default HeaderDown
